        instructions: 'Preheat the oven to 375 degrees.Melt butter in a small, shallow dish.In another shallow dish, stir together sugar and cinnamon.Roll out crescents. Dip a marshmallow in the butter, then the cinnamon sugar mixture then place it in the center of the crescent. Fold up the top two corners then roll the crescent up to the skinny end. Seal up all the edges. Repeat with remaining crescents and marshmallows.Place crescents on a rimmed baking sheet lined with parchment paper. If desired, mix together remaining butter and cinnamon sugar and brush it on the top of the crescents. Place in the oven and bake for 11-13 minutes or until crescents are light golden brown and puffy.Allow to cool slightly before serving.',
