        instructions: 'Procedures                                                                              1                                                                            For the Cake: Adjust oven rack to middle position and preheat oven to 350°F. Wrap 4 layers of heavy duty foil (See Notes) around exterior of  9- by 5-inch loaf pan, then coat interior with baking spray.                                                                                                                                2                                                                            Combine hibiscus flowers, boiling water, honey, and lemon juice in small bowl, mashing with fork to ensure flowers absorb liquid evenly. Allow flowers to steep until softened and liquid has been almost completely absorbed, about 15 minutes.                                                                                                                            3                                                                            In medium bowl, whisk together flour, baking powder, baking soda, and salt; set aside.                                                                                                                            4                                                                            In large bowl, beat butter on medium speed until creamy, about 1 minute. Add oil and sugar and continue to beat until light and fluffy, about 3 minutes. Add eggs in a slow steady stream and continue to beat until completely incorporated, about 1 minute.                                                                                                                            5                                                                            Decrease mixer speed to low and add flour mixture in three batches, alternating with milk. Scrape sides and bottom of bowl with rubber spatula as needed. Increase speed to medium and beat mixture just until combined, 20 to 30 seconds. Add vanilla and soaked hibiscus flowers beat once more, just to combine, about 20 seconds.                                                                                                                            6                                                                            Scrape batter into prepared pan. Bake 35 to 40 minutes, rotating cake halfway through baking, until cake tester inserted in center of cake comes out clean. Transfer cake to cooling and cool in pan 10 minutes. Invert cake onto plate or second cooling rack, then revert to original cooling rack so top of cake faces up. Cool completely, at least 1 hour. Serve with spread.                                                                                                                            7                                                                            For the Spread: Prepare spread while cake cools.                                                                                                                              8                                                                            In large bowl, beat cream cheese on medium speed until smooth, about 2 minutes. Add sour cream, honey, vanilla, and salt and continue beating until completely smooth, about 2 minutes.  Serve with cake.',
