        winePairing: {},
        instructions: 'In a mixing bowl, whisk together soy sauce, apple cider vinegar, light-brown sugar, honey, orange marmalade, molasses, grated ginger, garlic and pepper. Reserve 1 cup of sauce mixture in a bowl in refrigerator and pour remaining sauce over diced chicken in a large ziploc bag. Seal bag and place bag in a bowl (to prevent leaks) in refrigerator and allow chicken to marinate 4 hours in refrigerator. To prepare glaze, pour reserved 1 cup sauce into a small saucepan. In a small bowl, whisk together 1 Tbsp cold water and cornstarch, then pour cornstarch mixture into saucepan and stir. Bring sauce just to a boil over medium high heat, stirring frequently. Once mixture reaches a boil, reduce heat and allow to gently boil 1 minute,  stirring constantly. Remove from heat and allow to cool slightly.To prepare kabobs, using either metal skewers or water soaked wood skewers, thread a piece of marinated chicken (discard marinade), followed by an onion wedge, a chunk of red pepper, a chunk of green pepper and a chunk of pineapple, then repeat pattern twice and finish with an additional piece of chicken (I fit 4 pieces of chicken on the kebab total then 3 of everything else).Grill kebabs over medium heat, 12 - 16 minutes rotating once halfway through grilling, until chicken has fully cooked through. Remove from grill and brush kebabs with teriyaki sauce, serve warm with cooked white or brown rice if desired (alternately you can brush kebabs with teriyaki sauce during the last few minutes of grilling but I say why waste such good sauce that will drip to bottom of the grill).Recipe Source: Cooking Classy',
