        instructions: 'Directions                                                                                In a large skillet, brown roast in butter on all sides. Transfer to a 5-qt. slow cooker; sprinkle with soup mix. Add cranberry sauce to skillet, stirring to loosen browned bits from pan. Pour over roast.                                                                                           Cover and cook on low for 4-5 hours or until meat is tender. Remove roast to a serving platter; let stand for 10 minutes before slicing. Stir mustard into cooking juices. Serve with roast.                                        Yield: 6 servings.                                                                                                                         Originally published as Cranberry-Dijon Pork Roast in  Simple & DeliciousDecember/January 2011, p16                                                                                                                                                                                                        Nutritional Facts                                                                             4 ounces cooked pork with 1/3 cup sauce equals 337 calories, 11 g fat (5 g saturated fat), 85 mg cholesterol, 388 mg sodium, 29 g carbohydrate, 1 g fiber, 30 g protein.                                                                                                                                                                    Print                                                                                    Add to Recipe Box                            Email a Friend',
