        instructions: 'Bring 1 cup water and  cup sugar to a boil in a saucepan. While the mixture is heating, rinse the cranberries.After it has come to a boil and all of the sugar has dissolved, add the cranberries and bring to a boil again. I had to put a lid on it because the cranberries begin to pop and spray hot sugary liquid everywhere! Once it comes to a boil again, turn the heat down to low/medium and continue to simmer until it is thick and bubbly (you can remove the lid after all of the berries have popped).While the mixture is simmering, zest the orange and squeeze all of the juice out of it. Also zest the lime and squeeze the juice from one half of it. Add the zest and juices to the sauce. If it thins it out too much (personal preference) you can continue to simmer until it cooks down to your desired thickness.',
